import React, { Component } from 'react'

class PureComponent extends Component {
    constructor(props) {
        super(props)
        
        this.state = {
            count:0
        }
    }
    render() {
        return (
            <div>
                PureComponent
                <button className='btn btn-primary' onClick={()=>this.setState({count:0})}>click</button>
            </div>

        )
    }
}

export default PureComponent
